import React, { Component } from 'react'
import axios from 'axios'

import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class Weather extends Component {

    //Define state default values
    state = {
        weather: []
    };

     //Component Lifecycle Callback
    componentDidMount() {
        axios.get(`https:api.openweathermap.org/data/2.5/weather?q=Toronto&appid=0075d6a7c0a4afa060d8299f822f958f`)
        .then(res => {
            console.log(res.data);
            const weather = res.data;
            console.log(weather.coord);
            const data = res.data;
            this.setState({ data });
        })
    }


    render() {

        return (
            <Container className="container-fluid">

                <h1 className="text-center">User List</h1>
                {this.state.weather.map (w =>
                        <div className="col-lg-auto btn-info">
                            <b>{w.coord.lon} {w.coord.lat}</b>
                            <p>{w.coord.lon} </p>
                        </div>
                    )}
            </Container>
        )
    }

}
